import React from 'react';
import Inventory from './IngredientsList';
import Recipe from './Recipe';

export default function RecipeList({recipes}) {
    return (
        <>
        {recipes.map(recipe=>{
           return <>
            <Recipe 
            key={recipe.id} 
            {...recipe}    
            />
            <Inventory
                key={recipe.key}
            />
           </>
        }

        )}

        </>
    )
}
